import {useEffect, useState} from 'react';
import classes from './OneExamDetailAdminView.module.css';
import { useHistory} from 'react-router-dom';
import {AiOutlineArrowLeft} from 'react-icons/ai';
import AddParagraphSectionForm from './Forms/AddParagraphSection';


import WritingTest from './WritingTest';
import SpeakingTest from './SpeakingTest';
import ListeningTest from './ListeningTest';


import {getoneexamdetail} from '../../../../../../CommonApps/AllAPICalls';


import ExamResponses from './ExamResponses';

import ParagraphSections from './ParagraphSections';




const OneExamDetailAdminView=()=>{


   const history = useHistory();

   const [selectedExamId, setSelectedExamId] = useState(localStorage.getItem('selectedExamId'));

   const backButtonHandler=()=>{
     history.push('/app/dashboard/general/exams/');   
   }


   const [showAddParagraphSecForm, setShowAddParagraphSecForm] = useState(false);


   const showParagraphAddFormHandler=()=>{
     setShowAddParagraphSecForm(true);
   }


  const [rerender, setRerender] = useState(false);

   const closeFormRerender=()=>{

     setShowAddParagraphSecForm(false);
     setRerender(rerender=>!rerender);
   }


   const [oneExamData, getOneExamData] = useState(null);





   useEffect(()=>{

     let examId=selectedExamId;
     getoneexamdetail({examId, getOneExamData});



   },[selectedExamId, rerender]);


   const [showContent, setShowContent] = useState(true);
   const [cButtonColor, setCButtonColor] = useState({
	   color:"white",
	   backgroundColor:"var(--themeColor)"
   });
   const [rButtonColor, setRButtonColor] = useState({
           color:"grey",
           backgroundColor:"lightgrey"
   });




   const contentHandler=()=>{

    setShowContent(true);
    setCButtonColor({color:"white",
           backgroundColor:"var(--themeColor)"});
    setRButtonColor({color:"grey",
           backgroundColor:"lightgrey"
    });
   }


   const responseHandler=()=>{

    setShowContent(false);	   
    setRButtonColor({color:"white",
           backgroundColor:"var(--themeColor)"});
    setCButtonColor({color:"grey",
           backgroundColor:"lightgrey"
    });




   } 	



   console.log("oneExamData: ", oneExamData);




return <div className={classes.oneExamDetailAdminView}>



      <div className={classes.topTitle}>

	<button type="button" onClick={backButtonHandler} className={classes.backButton}> <AiOutlineArrowLeft/> Back </button>	
        <div>  <b>Admin Area </b> | Exam Id : {selectedExamId}</div>
      </div>

       <div className={classes.toggleDiv}> 

        <button type="button" className={classes.toggleButton1} onClick={contentHandler} 
	                      style={cButtonColor}> 
		<b> Content </b> 
	</button>
        <button type="button" className={classes.toggleButton1} onClick={responseHandler}
		               style={rButtonColor}> 
		<b> Test Responses </b> 
	</button>

       </div>


      { !showContent &&

         <ExamResponses oneExamData={oneExamData}/>

      }


      {  showContent && <>

       <div className={classes.readingSectionParent}>

         <div className={classes.sectionName}>
             <span><h2> Reading Test </h2></span>
         </div>

         <div className={classes.readingSectionButtons}>

	    <button type="button" className={classes.createButton} onClick={showParagraphAddFormHandler}> + Add a reading task  </button>	

         </div>

         { showAddParagraphSecForm &&

             <AddParagraphSectionForm onPress={closeFormRerender}
		                      oneExamData={oneExamData}
		                      />

	  }




         <ParagraphSections oneExamData={oneExamData}
	                    rerender={closeFormRerender}
		            />




       </div>





     <div className={classes.readingSectionParent}>

         <div className={classes.sectionName}>
             <span> <h2>Listening  Test</h2> </span>
         </div>


        <ListeningTest oneExamData={oneExamData} rerender={closeFormRerender}/>

     </div>



    <div className={classes.readingSectionParent}>

         <div className={classes.sectionName}>
             <span> <h2>Writing  Test</h2> </span>
         </div>

        <WritingTest oneExamData={oneExamData} rerender={closeFormRerender}/>

     </div>



     <div className={classes.readingSectionParent}>

         <div className={classes.sectionName}>
             <span><h2> Speaking  Test </h2></span>
         </div>

         <SpeakingTest oneExamData={oneExamData} rerender={closeFormRerender}/>


     </div>


    </>

    }












</div>


}

export default OneExamDetailAdminView;
